import React from 'react'
import {useState, useEffect} from 'react';
import CareerList from '../CareerList/CareerList';
import ExpList from "../ExpList/ExpList"
import "./Career.css";
import { proj_feat, proj_pers, proj_acad, exp_it, exp_swe, education, lang } from "../../data"

const expPerPage = 4;
let arrayForHoldingPosts = [];

export default function Career() {

    // CareerList hooks & states
    const [selectedProject, setSelectedProject] = useState("featured");
    const [selectedExperience, setSelectedExperience] = useState("all");
    const [projectData, setProjectData] = useState([]);
    const [expData, setExpData] = useState([]);
    const edu = education;
    const lan = lang;

    // yes
    const [expToShow, setExpToShow] = useState([]);
    const [next, setNext] = useState(4);

    const showNext = (start, end) => {
        setExpToShow(projectData.slice(start,))
    };

    useEffect(() => {
        loopWithSlice(0, expPerPage);
    }, []);

    const handleShowMoreExp = () => {
        loopWithSlice(next, next + expPerPage);
        setNext(next + expPerPage);
    };

    const projectsList = [
        {
            id: "all",
            name: "All"
        },
        {
            id: "featured",
            name: "Featured"
        },
        {
            id: "academic",
            name: "Academic"
        },
        {
            id: "personal",
            name: "Personal"
        }
    ]

    const experienceList = [
        {
            id: "all",
            name: "All"
        },
        {
            id: "swe",
            name: "Software Engineering"
        },
        {
            id: "it",
            name: "IT"
        }
    ]

    const test = {
        id: 0,
        title: "a",
        desc: "b",
        startend: "0"
    }

    useEffect(() => {
        switch(selectedProject) {
            case "featured":
                setProjectData(proj_feat);
                break;
            case "academic":
                setProjectData(proj_acad);
                break;
            case "personal":
                setProjectData(proj_pers);
                break;
            default:
                setProjectData(proj_pers.concat(proj_acad));
                break;
        }
        switch(selectedExperience) {
            case "swe":
                setExpData(exp_swe);
                break;
            case "it":
                setExpData(exp_it);
                break;
            default:
                setExpData(exp_swe.concat(exp_it));
                break;
            
        }
        showNext(0, expPerPage);
    })

    return (
        <div className="career" id="career">
            <h1>Career</h1>
            <div className="container">
                <div className="left">
                    <h2 className="title">Projects</h2>
                    <ul>
                        {projectsList.map(item=>(
                            <CareerList id={item.id} name={item.name} active={selectedProject === item.id} setSelected={setSelectedProject}></CareerList>
                        ))}
                    </ul>
                    <div className="career-items">
                        {expToShow.map((d) => (
                            <div className="item"> 
                                <a href={d.link} target="_blank"><img src={d.img} alt={d.desc}></img></a>
                                <div className="overlay">
                                    <h3 id="name">{d.title}</h3>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
                <div className="right">
                    <h2 className="title">Experience</h2>
                    <ul>
                        {experienceList.map(item=>(
                            <CareerList id={item.id} name={item.name} active={selectedExperience === item.id} setSelected={setSelectedExperience}></CareerList>
                        ))}
                    </ul>
                    <div className="career-items">
                        {expData.map((d) => (
                            <div className="item"> 
                                <a href={d.link} target="_blank"><img src={d.img} alt={d.desc}></img></a>
                                <div className="overlay">
                                    <h3 id="name">{d.title}</h3>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </div>
            
        </div>
    )
}
